async with get_database() as database:
    assert await database.select_max(ExchangeDataTables.OHLCV, ['timestamp']
        ) == [(1590883200,)]
    assert await database.select_max(ExchangeDataTables.OHLCV, ['timestamp'
        ], time_frame='1h') == [(1589742000,)]
    assert await database.select_max(ExchangeDataTables.OHLCV, ['timestamp'
        ], ['symbol'], time_frame='1h') == [(1589742000, 'ETH/BTC')]
